function aoc_5(polymer){
	// part 1
	console.log('part 1: %i', polymerLength(polymer.split('')));
	
	// part 2
	for(var i = 0, min = polymer.length; i < 26; i++){
		var p = polymer.replace(new RegExp(String.fromCharCode(i + 65), 'gi'), '');
		min = Math.min(min, polymerLength(p.split('')));
	}
	console.log('part 2: %i', min);
}

function polymerLength(polymer){
	for(var i = 0; i < polymer.length - 2; i+= 0){
		if(polymer[i] != polymer[i + 1] && polymer[i].toLowerCase() == polymer[i + 1].toLowerCase())
			polymer.splice(i == 0 ? i : i--, 2);
		else
			i++;
	}
	
	return polymer.length;
}

aoc_5('');
